import React from "react";
import logo from "./assets/logo.png";
import pillarLeft from "./assets/pillarLeft.png";
import pillarRight from "./assets/pillarRight.png";
// We import bootstrap to make our application look better.
import "bootstrap/dist/css/bootstrap.css";

// We import NavLink to utilize the react router.
import { NavLink } from "react-router-dom";

// Here, we display our Navbar
export default function Navbar() {
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light bg-dark" style={{"justify-content" : "center"}}>
        <img style={{"width" : 8 + '%'}} src={pillarLeft}></img>
        <NavLink className="navbar-brand" to="/">
        <img style={{"width" : 15 + '%'}} src={logo}></img>
        </NavLink>
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <a href="/create">
                <button type="button" class="btn btn-light">Enter Flip</button>
              </a>
            </li>
          </ul>
        </div>
        <div>
        <img style={{"width" : 55 + '%'}} src={pillarRight}></img>
        </div>
      </nav>
    </div>
  );
}
